	(34,'How to become a fullstack developer','public','admin','A full stack developer is an engineer who can handle all the work of databases, servers, systems engineering, and clients. As one of the hottest topics for developers, the discussions have never stopped. On LinkedIn and Facebook, lots of people put their job title as a full stack developer.','[{\"value\":\"Tech\",\"icon\":\"cpu\",\"color\":\"#347C2C\"}]',NULL,NULL,64,NULL,104,'2021-07-25 14:19:04','2021-07-25 14:19:04','{\"value\":\"Entrepreneurship\",\"icon\":\"card-heading\",\"id\":1,\"color\":\"#3C565B\",\"image\":\"\\/img\\/nine.png\"}'),
	(44,'Javascript Functions','public','admin','A function in JavaScript is similar to a procedure—a set of statements that performs a task or calculates a value, but for a procedure to qualify as a function, it should take some input and return an output where there is some obvious relationship between the input and the output.','[{\"value\":\"Tech\",\"icon\":\"cpu\",\"color\":\"#347C2C\"}]',NULL,NULL,64,NULL,104,'2021-07-25 14:20:08','2021-07-25 14:20:08','{\"value\":\"Career Development\",\"icon\":\"ladder\",\"id\":2,\"color\":\"#0000A5\",\"image\":\"\\/img\\/eight.png\"}');
