	(364,'[{\"title\":\"How I will compete to win\",\"description\":\"<div class=\\\"page\\\" title=\\\"Page 17\\\">\\n<div class=\\\"layoutArea\\\">\\n<div class=\\\"column\\\">\\n<p style=\\\"text-align: center;\\\"><em>&ldquo;The more you understand about your own company and how you differ from others, the better you are able to compete.&rdquo;<\\/em><\\/p>\\n<p>Understanding the needs, interests, habits, and preferences of your customers is the key to providing exceptional customer experiences. Your UVP helps you connect with your target market by articulating your value to your customer and what makes you different.<\\/p>\\n<\\/div>\\n<\\/div>\\n<\\/div>\",\"showSection\":true,\"questions\":[{\"fixed\":false,\"showQuestion\":false,\"question\":\"Briefly summarize your customer\\u2019s pain point and how your product solves it:\",\"addSubQuestion\":true,\"subQuestion\":[{\"show\":true,\"question\":null,\"placeholders\":[{\"placeholder\":\"My Customer\",\"response\":null},{\"placeholder\":\"Their problem\",\"response\":null},{\"placeholder\":\"How my product\\/service solves it\",\"response\":null}],\"limit\":2,\"options\":[{\"value\":null}],\"answer\":null,\"answers\":[],\"response\":null,\"responses\":[],\"response_count\":null}],\"response\":null,\"responses\":[],\"result\":null,\"type\":\"long\",\"limit\":2,\"options\":[{\"value\":null}],\"showAnswer\":false,\"answer\":null,\"answers\":[],\"placeholders\":[{\"placeholder\":null,\"response\":null}],\"placeholder\":null,\"hint\":null,\"score\":0}]}]',NULL,'My Unique Value Proposition',74,'2021-07-26 09:08:19','2021-07-28 19:19:20','worksheet','active',NULL,NULL,44,NULL,'{\"grading\":false,\"correct_answer\":false,\"time\":false}',NULL),
	(374,'[{\"title\":\"Here\'s what to note\",\"description\":\"<p class=\\\"p1\\\">This module aims at sharpening your understanding of your marketplace: your competitors, geographical boundaries, types of customers you sell to, existing distribution channels, latest and most useful demographic data, any information on trends in your markets (both demographic and product-related)<\\/p>\\n<p class=\\\"p1\\\">However, this is dependent on your research abilities. The word &lsquo;research&rsquo; probably conjures up school projects, but this kind of research isn&rsquo;t like that. Instead you&rsquo;ll get shortcuts to finding critical business information&mdash; whether it be about your industry, target market, competitors, or other business information you&rsquo;ll need<span class=\\\"Apple-converted-space\\\">&nbsp; <\\/span>to help you build your business and make decisions.<\\/p>\\n<p class=\\\"p1\\\">The emphasis will be on finding such information fast, easily and hopefully free.<\\/p>\\n<p class=\\\"p1\\\">We&rsquo;re also going to use a number of frameworks on the w<span class=\\\"s1\\\">orksheets<\\/span> to answer such questions as:<\\/p>\\n<ul>\\n<li class=\\\"p1\\\">Who is really your customer?<\\/li>\\n<li class=\\\"p1\\\">What companies are already providing such a service?<\\/li>\\n<li class=\\\"p1\\\">What is the addressable market size for this kind of product\\/service?<\\/li>\\n<li class=\\\"p1\\\">What are indicators that there are consumers who would be willing to get the product\\/service you&rsquo;re proposing?<\\/li>\\n<li class=\\\"p1\\\">What portion of the existing market can you realistically capture?<\\/li>\\n<li class=\\\"p1\\\">What are the costs involved in providing the proposed product\\/service?<\\/li>\\n<li class=\\\"p1\\\">What are the key activities, resources such as technology and partnerships needed to provide proposed product\\/service?<\\/li>\\n<li class=\\\"p1\\\">What are the laws and regulatory implications of offering such products and services?<\\/li>\\n<\\/ul>\\n<p class=\\\"p1\\\">But first, lets discuss how to get started:<\\/p>\\n<p class=\\\"p1\\\"><strong>Defining your target market:<\\/strong><\\/p>\\n<p class=\\\"p1\\\"><em>Even if you think you&rsquo;ll market directly to consumers online, you will soon discover that there are still many entities between you and your customer.<\\/em><\\/p>\\n<p class=\\\"p1\\\">Let&rsquo;s say you&rsquo;ve created a new breakfast cereal for children. You&rsquo;ve packed it with good things: vitamins, minerals, great nutrition etc. You have enough punch to wipe out competition, because every parent wants a nutritious breakfast for their child. Who is your customer? Is it mum or dad pushing the grocery cart down the cereal aisle, comparing the nutrition information on the side of the box? Or is it the end-user (the &ldquo;Consumer&rdquo;) of your product&mdash; the kid&mdash; who couldn&rsquo;t care less about nutrition, but wants cereal that tastes sweet, has cartoon characters on the package, and packs toys inside?<\\/p>\\n<p class=\\\"p1\\\">Confused yet? hehe! typically your customers cut across different categories that grows as you get closer to the end user. See outline below:<\\/p>\\n<ul>\\n<li class=\\\"p1\\\">End User\\/Consumer<\\/li>\\n<li class=\\\"p1\\\">Purchaser\\/Decision Maker<\\/li>\\n<li class=\\\"p1\\\">Retail Sales Personnel<\\/li>\\n<li class=\\\"p1\\\">Retailer Decision Makers<\\/li>\\n<li class=\\\"p1\\\">Wholesale\\/Distributor Sales Personnel<\\/li>\\n<li class=\\\"p1\\\">Wholesale\\/Distributor Decision Makers<\\/li>\\n<li class=\\\"p1\\\">Others<\\/li>\\n<\\/ul>\\n<p class=\\\"p1\\\">Give yourself a competitive edge by thinking of each of these customers and plan for their needs and motivation. I know its hard to see why now, but being responsive to details that are important to distributors, retailers, sales reps etc. help you plan your marketing materials, operation, packaging and even the nature of the product itself.<\\/p>\\n<p class=\\\"p1\\\">Even if you think you&rsquo;ll market directly to consumers online, you will soon discover that there are still many entities between you and your customer, it could be the algorithm of your preferred social media platform, or the search engine that will help customers find you.<\\/p>\",\"showSection\":true,\"questions\":[{\"fixed\":false,\"showQuestion\":true,\"question\":\"Ready to reach those customers of yours?\",\"addSubQuestion\":false,\"subQuestion\":[{\"show\":true,\"question\":null,\"placeholders\":[{\"placeholder\":null,\"response\":null}],\"limit\":2,\"options\":[{\"value\":null}],\"answer\":null,\"answers\":[],\"response\":null,\"responses\":[],\"response_count\":null}],\"response\":null,\"responses\":[],\"result\":null,\"type\":\"single\",\"limit\":2,\"options\":[{\"value\":\"Yesssuur!\"},{\"value\":\"Can\'t wait!\"}],\"showAnswer\":false,\"answer\":null,\"answers\":[],\"placeholders\":[{\"placeholder\":null,\"response\":null}],\"placeholder\":null,\"hint\":null,\"score\":0}]}]',NULL,'A guide to developing your marketing plan',74,'2021-07-29 00:32:34','2021-07-29 10:46:59','worksheet','active',NULL,NULL,44,NULL,'{\"grading\":false,\"correct_answer\":false,\"time\":false}',NULL),
	(384,'[{\"title\":\"Your target market\",\"description\":null,\"showSection\":true,\"questions\":[{\"fixed\":false,\"showQuestion\":false,\"question\":\"Briefly define your target market:\",\"addSubQuestion\":false,\"subQuestion\":[{\"show\":true,\"question\":null,\"placeholders\":[{\"placeholder\":null,\"response\":null}],\"limit\":2,\"options\":[{\"value\":null}],\"answer\":null,\"answers\":[],\"response\":null,\"responses\":[],\"response_count\":null}],\"response\":null,\"responses\":[],\"result\":null,\"type\":\"long\",\"limit\":2,\"options\":[{\"value\":null}],\"showAnswer\":false,\"answer\":null,\"answers\":[],\"placeholders\":[{\"placeholder\":null,\"response\":null}],\"placeholder\":null,\"hint\":\"Your customers cut across different categories that grows as you get closer to the end user, give yourself a competitive edge by thinking of each of these customers and plan for their needs and motivation.\",\"score\":0},{\"fixed\":false,\"showQuestion\":false,\"question\":\"Briefly describe your customer persona:\",\"addSubQuestion\":false,\"subQuestion\":[{\"show\":true,\"question\":null,\"placeholders\":[{\"placeholder\":null,\"response\":null}],\"limit\":2,\"options\":[{\"value\":null}],\"answer\":null,\"answers\":[],\"response\":null,\"responses\":[],\"response_count\":null}],\"response\":null,\"responses\":[],\"result\":null,\"type\":\"long\",\"limit\":2,\"options\":[{\"value\":null}],\"showAnswer\":false,\"answer\":null,\"answers\":[],\"placeholders\":[{\"placeholder\":null,\"response\":null}],\"placeholder\":null,\"hint\":\"Simply put, your ideal customer is the one who benefits the most from what you\\u2019re selling.\",\"score\":0},{\"fixed\":false,\"showQuestion\":false,\"question\":\"What is the estimated size of your market?\",\"addSubQuestion\":false,\"subQuestion\":[{\"show\":true,\"question\":null,\"placeholders\":[{\"placeholder\":null,\"response\":null}],\"limit\":2,\"options\":[{\"value\":null}],\"answer\":null,\"answers\":[],\"response\":null,\"responses\":[],\"response_count\":null}],\"response\":null,\"responses\":[],\"result\":null,\"type\":\"short\",\"limit\":2,\"options\":[{\"value\":null}],\"showAnswer\":false,\"answer\":null,\"answers\":[],\"placeholders\":[{\"placeholder\":null,\"response\":null}],\"placeholder\":null,\"hint\":\"This helps to determine if there are enough customers to serve\",\"score\":0},{\"fixed\":false,\"showQuestion\":false,\"question\":\"Is it declining or increasing?\",\"addSubQuestion\":false,\"subQuestion\":[{\"show\":true,\"question\":null,\"placeholders\":[{\"placeholder\":null,\"response\":null}],\"limit\":2,\"options\":[{\"value\":null}],\"answer\":null,\"answers\":[],\"response\":null,\"responses\":[],\"response_count\":null}],\"response\":null,\"responses\":[],\"result\":null,\"type\":\"single\",\"limit\":2,\"options\":[{\"value\":\"Declining\"},{\"value\":\"Increasing\"}],\"showAnswer\":false,\"answer\":null,\"answers\":[],\"placeholders\":[{\"placeholder\":null,\"response\":null}],\"placeholder\":null,\"hint\":null,\"score\":0},{\"fixed\":false,\"showQuestion\":true,\"question\":\"At what rate?\",\"addSubQuestion\":false,\"subQuestion\":[{\"show\":true,\"question\":null,\"placeholders\":[{\"placeholder\":null,\"response\":null}],\"limit\":2,\"options\":[{\"value\":null}],\"answer\":null,\"answers\":[],\"response\":null,\"responses\":[],\"response_count\":null}],\"response\":null,\"responses\":[],\"result\":null,\"type\":\"short\",\"limit\":2,\"options\":[{\"value\":null}],\"showAnswer\":false,\"answer\":null,\"answers\":[],\"placeholders\":[{\"placeholder\":null,\"response\":null}],\"placeholder\":null,\"hint\":null,\"score\":0}]}]',NULL,'Defining your target market',74,'2021-07-29 00:44:49','2021-07-29 10:47:38','worksheet','active',NULL,NULL,44,NULL,'{\"grading\":false,\"correct_answer\":false,\"time\":false}',NULL),
	(394,'[{\"title\":\"SWOT Analysis\",\"description\":\"<p>SWOT Analysis is the most renowned tool for audit and analysis of the overall strategic position of the business and its environment. Its key purpose is to identify the strategies that will best align an organization&rsquo;s resources and capabilities to the requirements of the&nbsp;environment in which it operates.<\\/p>\\n<p class=\\\"p1\\\"><strong>SWOT Analysis<\\/strong>&nbsp;is the most renowned tool for audit and analysis of the overall strategic position of the business and its environment. Its key purpose is to identify the strategies that will best align an organization&rsquo;s resources and capabilities to the requirements of the environment in which it operates.<\\/p>\\n<p class=\\\"p1\\\">Here&rsquo;s a quick break down of SWOT:<\\/p>\\n<p class=\\\"p3\\\">&nbsp;<\\/p>\\n<p class=\\\"p1\\\"><strong>Strengths<\\/strong> are the qualities that enable us to accomplish the organization&rsquo;s mission. These are what you are well versed in or what you have expertise in, the traits and qualities your employees possess (individually and as a team) and the distinct features that give your organization its consistency.<\\/p>\\n<p class=\\\"p2\\\">&nbsp;<\\/p>\\n<p class=\\\"p1\\\"><strong>Weaknesses<\\/strong> are the qualities that prevent us from accomplishing our mission and achieving our full potential. They are the factors that do not meet the standards we feel they should meet.<\\/p>\\n<p class=\\\"p3\\\">&nbsp;<\\/p>\\n<p class=\\\"p1\\\"><strong>Opportunities<\\/strong> are presented by the environment within which our organization operates. Organizations can gain competitive advantage by making use of opportunities.<\\/p>\\n<p class=\\\"p2\\\">&nbsp;<\\/p>\\n<p class=\\\"p1\\\"><strong>Threats <\\/strong>arise when conditions in external environment jeopardize the reliability and profitability of the organization&rsquo;s business. They compound the vulnerability when they relate to the weaknesses.<\\/p>\",\"showSection\":true,\"questions\":[{\"fixed\":false,\"showQuestion\":true,\"question\":\"Top 5 strengths of my business:\",\"addSubQuestion\":false,\"subQuestion\":[{\"show\":true,\"question\":null,\"placeholders\":[{\"placeholder\":null,\"response\":null}],\"limit\":2,\"options\":[{\"value\":null}],\"answer\":null,\"answers\":[],\"response\":null,\"responses\":[],\"response_count\":null}],\"response\":null,\"responses\":[],\"result\":null,\"type\":\"short\",\"limit\":2,\"options\":[{\"value\":null}],\"showAnswer\":false,\"answer\":null,\"answers\":[],\"placeholders\":[{\"placeholder\":null,\"response\":null},{\"placeholder\":null,\"response\":null},{\"placeholder\":null,\"response\":null},{\"placeholder\":null,\"response\":null},{\"placeholder\":null,\"response\":null}],\"placeholder\":null,\"hint\":\"What you are well-versed or have expertise in\",\"score\":0},{\"fixed\":false,\"showQuestion\":false,\"question\":\"Top 5 weaknesses of my business:\",\"addSubQuestion\":false,\"subQuestion\":[{\"show\":true,\"question\":null,\"placeholders\":[{\"placeholder\":null,\"response\":null}],\"limit\":2,\"options\":[{\"value\":null}],\"answer\":null,\"answers\":[],\"response\":null,\"responses\":[],\"response_count\":null}],\"response\":null,\"responses\":[],\"result\":null,\"type\":\"short\",\"limit\":2,\"options\":[{\"value\":null}],\"showAnswer\":false,\"answer\":null,\"answers\":[],\"placeholders\":[{\"placeholder\":null,\"response\":null},{\"placeholder\":null,\"response\":null},{\"placeholder\":null,\"response\":null},{\"placeholder\":null,\"response\":null},{\"placeholder\":null,\"response\":null}],\"placeholder\":null,\"hint\":\"Qualities that prevent your business from accomplishing its mission and achieving its full potential.\",\"score\":0},{\"fixed\":false,\"showQuestion\":false,\"question\":\"Top 5 opportunities for my business:\",\"addSubQuestion\":false,\"subQuestion\":[{\"show\":true,\"question\":null,\"placeholders\":[{\"placeholder\":null,\"response\":null}],\"limit\":2,\"options\":[{\"value\":null}],\"answer\":null,\"answers\":[],\"response\":null,\"responses\":[],\"response_count\":null}],\"response\":null,\"responses\":[],\"result\":null,\"type\":\"short\",\"limit\":2,\"options\":[{\"value\":null}],\"showAnswer\":false,\"answer\":null,\"answers\":[],\"placeholders\":[{\"placeholder\":null,\"response\":null},{\"placeholder\":null,\"response\":null},{\"placeholder\":null,\"response\":null},{\"placeholder\":null,\"response\":null},{\"placeholder\":null,\"response\":null}],\"placeholder\":null,\"hint\":\"Presented by the environment within which your business operates\",\"score\":0},{\"fixed\":false,\"showQuestion\":true,\"question\":\"Top 5 threats to my business:\",\"addSubQuestion\":false,\"subQuestion\":[{\"show\":true,\"question\":null,\"placeholders\":[{\"placeholder\":null,\"response\":null}],\"limit\":2,\"options\":[{\"value\":null}],\"answer\":null,\"answers\":[],\"response\":null,\"responses\":[],\"response_count\":null}],\"response\":null,\"responses\":[],\"result\":null,\"type\":\"short\",\"limit\":2,\"options\":[{\"value\":null}],\"showAnswer\":false,\"answer\":null,\"answers\":[],\"placeholders\":[{\"placeholder\":null,\"response\":null},{\"placeholder\":null,\"response\":null},{\"placeholder\":null,\"response\":null},{\"placeholder\":null,\"response\":null},{\"placeholder\":null,\"response\":null}],\"placeholder\":null,\"hint\":\"Conditions in external environment that jeopardize the reliability and profitability of your business.\",\"score\":0}]}]',NULL,'Your Situation Analysis (SWOT)',74,'2021-07-29 00:59:20','2021-07-29 10:47:58','worksheet','active',NULL,NULL,44,NULL,'{\"grading\":false,\"correct_answer\":false,\"time\":false}',NULL),
	(404,'[{\"title\":\"Analyzing your industry\",\"description\":\"<p class=\\\"p1\\\">The purpose of the competitive analysis is to determine the strengths and weaknesses of the competitors within your market, then based on that develop strategies that will provide you with a distinct advantage, and barriers that prevent potential competition from entering your market.<\\/p>\\n<p class=\\\"p1\\\">The first step in a competitor analysis is to identify the current and potential competition. There are essentially two ways you can identify competitors. The first is to look at the market from the customer\'s viewpoint and group all your competitors by the degree to which they contend for the buyer\'s money. The second method is to group competitors according to their various competitive strategies so you understand what motivates them. Being a strategist, I tend to use the second option more.<\\/p>\\n<p class=\\\"p1\\\">Once you have grouped your competitors, you can start to analyze their strategies and identify the areas where they are most vulnerable. This can be done through an examination of your competitors\' weaknesses and strengths.<\\/p>\\n<p class=\\\"p1\\\"><strong>Please note that competition comes in several forms:<\\/strong><\\/p>\\n<p class=\\\"p1\\\"><strong>Direct competitors:<\\/strong> The ones who keep you up at night. They resemble your company; close to customers, ambitious and trying to reach the same target market. You better keep an eye on these guys.<\\/p>\\n<p class=\\\"p1\\\"><strong>Online Competitors: <\\/strong>Reality check, your competitor isn&rsquo;t just on the next block or even within your state. You could find yourself battling it out for customers with someone from the other side of the world. Please take these online competitors very, very seriously.<\\/p>\\n<p class=\\\"p1\\\"><strong>The big guys:<\\/strong> Nestle, Dangote, PZ and national franchises with huge marketing budgets. Don&rsquo;t just dismiss these as being no issue&mdash; a lot of them have adopted customer service practices that used to be the hallmark of small business. These are very real competitors to you, especially if you plan to compete on the basis of price.<\\/p>\\n<p class=\\\"p1\\\"><strong>Alternatives: <\\/strong>When thinking about competition, you must also<span class=\\\"Apple-converted-space\\\">&nbsp; <\\/span>consider all other ways the customer can spend their time and money. I mean, a customer can choose to go on vacation rather than buy your hair, right? You get the gist. hehe<\\/p>\\n<p class=\\\"p1\\\"><strong>Inertia Factors: <\\/strong>Your customers can simply decide not to spend their money on anything at all, and this will not be due to your product not being valuable. During tough economic periods, it can be difficult to persuade people to part with their hard earned cash.<\\/p>\\n<p class=\\\"p1\\\"><strong>Potential future competitors: <\\/strong>There are competitors you will face tomorrow, and these might differ from what you expect. I bet you this COVID-19 pandemic many businesses were finally faced with competition from the most unlikely places. Keep your eyes open, competition can emerge from the unlikeliest places.<\\/p>\",\"showSection\":true,\"questions\":[{\"fixed\":false,\"showQuestion\":true,\"question\":\"Competitor Analysis:\",\"addSubQuestion\":true,\"subQuestion\":[{\"show\":false,\"question\":\"My top 5 competitors:\",\"placeholders\":[{\"placeholder\":null,\"response\":null},{\"placeholder\":null,\"response\":null},{\"placeholder\":null,\"response\":null},{\"placeholder\":null,\"response\":null},{\"placeholder\":null,\"response\":null}],\"limit\":2,\"options\":[{\"value\":null}],\"answer\":null,\"answers\":[],\"response\":null,\"responses\":[],\"response_count\":null},{\"show\":true,\"question\":\"Top 5 similarities:\",\"placeholders\":[{\"placeholder\":null,\"response\":null},{\"placeholder\":null,\"response\":null},{\"placeholder\":null,\"response\":null},{\"placeholder\":null,\"response\":null},{\"placeholder\":null,\"response\":null}],\"limit\":2,\"options\":[{\"value\":null}],\"answer\":null,\"answers\":[],\"response\":null,\"responses\":[],\"response_count\":null},{\"show\":false,\"question\":\"What can I learn from them?\",\"placeholders\":[{\"placeholder\":null,\"response\":null},{\"placeholder\":null,\"response\":null},{\"placeholder\":null,\"response\":null},{\"placeholder\":null,\"response\":null},{\"placeholder\":null,\"response\":null}],\"limit\":2,\"options\":[{\"value\":null}],\"answer\":null,\"answers\":[],\"response\":null,\"responses\":[],\"response_count\":null},{\"show\":true,\"question\":\"How can I differentiate from them?\",\"placeholders\":[{\"placeholder\":null,\"response\":null},{\"placeholder\":null,\"response\":null},{\"placeholder\":null,\"response\":null},{\"placeholder\":null,\"response\":null},{\"placeholder\":null,\"response\":null}],\"limit\":2,\"options\":[{\"value\":null}],\"answer\":null,\"answers\":[],\"response\":null,\"responses\":[],\"response_count\":null}],\"response\":null,\"responses\":[],\"result\":null,\"type\":\"long\",\"limit\":2,\"options\":[{\"value\":null}],\"showAnswer\":false,\"answer\":null,\"answers\":[],\"placeholders\":[{\"placeholder\":null,\"response\":null}],\"placeholder\":null,\"hint\":\"Note that competition comes in several forms: direct, online, the big guys, alternatives, potential competitors etc.\",\"score\":0}]}]',NULL,'Your Industry Analysis',74,'2021-07-29 01:09:35','2021-07-29 10:48:20','worksheet','active',NULL,NULL,44,NULL,'{\"grading\":false,\"correct_answer\":false,\"time\":false}',NULL),
	(414,'[{\"title\":\"Setting your marketing goals\",\"description\":\"<p class=\\\"p1\\\">This is where you paint your picture of the future: What marketing objectives do you want to achieve over the course of the plan? Each of your marketing objectives should include both a narrative description of what you intend to accomplish along with numbers to give you something concrete to aim for.<\\/p>\\n<p class=\\\"p1\\\">Just to say you want to make a first entry into the tailoring materials marketplace isn\'t providing much guidance. Saying you want to go from 0 percent to 8 percent of the local market in two years is easier to understand and verifiable. If you\'re not sure of the size of the local market, then aim at setting a figure in sales e.g. I want to sell N50,000 worth of goods every week.<\\/p>\\n<p class=\\\"p1\\\">You should make it a point to limit the number of marketing objectives you take on in a given year. Let\'s face it, change can bring stress, disorient staff and sometimes even confuse your target market. Keep your objectives challenging but achievable. Better to motivate yourself with ambitious but worthy targets than to depress yourself by failing at too many enthusiastic goals.<\\/p>\\n<p class=\\\"p1\\\">Here are some typical marketing objective categories:<\\/p>\\n<ul class=\\\"ul1\\\">\\n<li class=\\\"li1\\\">Introduce new products<\\/li>\\n<li class=\\\"li1\\\">Extend or regain market for existing product<\\/li>\\n<li class=\\\"li1\\\">Enter new territories for the company<\\/li>\\n<li class=\\\"li1\\\">Boost sales in a particular product, market or price range. Where will this business come from? Be specific.<\\/li>\\n<li class=\\\"li1\\\">Cross-sell (or bundle) one product with another<\\/li>\\n<li class=\\\"li1\\\">Enter into long-term contracts with desirable clients<\\/li>\\n<li class=\\\"li1\\\">Raise prices without cutting into sales figures<\\/li>\\n<li class=\\\"li1\\\">Refine a product<\\/li>\\n<li class=\\\"li1\\\">Enhance manufacturing\\/product delivery<\\/li>\\n<\\/ul>\\n<p class=\\\"p1\\\">You get the idea. If your objective is to build a business in Kaduna, you have to put together concrete goals to make it happen. Each of these actions makes sense. You might come up with others (there\'s no limit to human creativity, after all, especially in marketing). The point is that each goal should consist of concrete actions.<\\/p>\\n<p class=\\\"p1\\\"><strong>Don&rsquo;t forget your budgets and controls; <\\/strong>whether done well or poorly, business activity always costs money. Your marketing plan needs to have a section in which you allocate budgets for each activity planned. However, do not rely on financial goals alone, since in most cases, there is a delayed reaction to worsening figures. Goals relating to your market and customers (e.g. decreasing customer satisfaction) are often early indicators of a change.<\\/p>\\n<p class=\\\"p3\\\">&nbsp;<\\/p>\",\"showSection\":true,\"questions\":[{\"fixed\":false,\"showQuestion\":true,\"question\":\"My marketing goals:\",\"addSubQuestion\":true,\"subQuestion\":[{\"show\":true,\"question\":\"Short Term:\",\"placeholders\":[{\"placeholder\":\"Financial goal\",\"response\":null},{\"placeholder\":\"Customer\\/Market goal\",\"response\":null},{\"placeholder\":\"Budget\",\"response\":null}],\"limit\":2,\"options\":[{\"value\":null}],\"answer\":null,\"answers\":[],\"response\":null,\"responses\":[],\"response_count\":null},{\"show\":true,\"question\":\"Mid-term\",\"placeholders\":[{\"placeholder\":\"Financial goal\",\"response\":null},{\"placeholder\":\"Customer\\/Market goal\",\"response\":null},{\"placeholder\":\"Budget\",\"response\":null}],\"limit\":2,\"options\":[{\"value\":null}],\"answer\":null,\"answers\":[],\"response\":null,\"responses\":[],\"response_count\":null},{\"show\":true,\"question\":\"Long Term\",\"placeholders\":[{\"placeholder\":\"Financial goal\",\"response\":null},{\"placeholder\":\"Customer\\/Market goal\",\"response\":null},{\"placeholder\":\"Budget\",\"response\":null}],\"limit\":2,\"options\":[{\"value\":null}],\"answer\":null,\"answers\":[],\"response\":null,\"responses\":[],\"response_count\":null}],\"response\":null,\"responses\":[],\"result\":null,\"type\":\"long\",\"limit\":2,\"options\":[{\"value\":null}],\"showAnswer\":false,\"answer\":null,\"answers\":[],\"placeholders\":[{\"placeholder\":null,\"response\":null}],\"placeholder\":null,\"hint\":null,\"score\":0}]}]',NULL,'My marketing goals',74,'2021-07-29 01:14:51','2021-07-29 10:48:54','worksheet','active',NULL,NULL,44,NULL,'{\"grading\":false,\"correct_answer\":false,\"time\":false}',NULL),
