	(444,'[{\"title\":\"Tips for creating a sales plan\",\"description\":\"<p class=\\\"p1\\\">Your sales plan is basically your strategic and tactical plan for acquiring new business, growing your existing business and making and\\/or exceeding your sales quota within our sales territory. Typically, a healthy mix would include 75 percent of your sales quota from new business and 25 percent of your quota from add-on business from your existing customers.<\\/p>\\n<p class=\\\"p1\\\"><strong>There are four basic considerations for a good sales plan:<\\/strong><\\/p>\\n<ol class=\\\"ol1\\\">\\n<li class=\\\"li1\\\">New business acquisition strategies<\\/li>\\n<li class=\\\"li1\\\">New business acquisition tactics<\\/li>\\n<li class=\\\"li1\\\">Existing business growth strategies<\\/li>\\n<li class=\\\"li1\\\">Existing business growth tactics<\\/li>\\n<\\/ol>\\n<p class=\\\"p1\\\">Before you continue, let&rsquo;s unpack some popular sales definitions:<\\/p>\\n<ul class=\\\"ul1\\\">\\n<li class=\\\"li1\\\"><strong>Sales quota:<\\/strong>&nbsp;This critical element of your plan sets the tempo of your efforts throughout the year and provides quarterly, monthly, weekly and even daily <span class=\\\"s2\\\">sub-goals <\\/span>for you to achieve.<\\/li>\\n<li class=\\\"li1\\\"><strong>Sales territory:<\\/strong>&nbsp;Refers to the <span class=\\\"s2\\\">geographic area<\\/span>, list of named accounts or specific market niche in which you are to sell your products, services and solutions.<\\/li>\\n<li class=\\\"li1\\\"><strong>Strategies:<\\/strong>&nbsp;The <span class=\\\"s2\\\">plan<\\/span> necessary to accomplish your goal.<\\/li>\\n<li class=\\\"li1\\\"><strong>Tactics:<\\/strong>&nbsp;The <span class=\\\"s2\\\">steps<\\/span> necessary to carry out the plan.<\\/li>\\n<\\/ul>\\n<p class=\\\"p1\\\"><strong>For example, if your <\\/strong><span class=\\\"s2\\\"><strong>strategy <\\/strong><\\/span><strong>for <\\/strong><span class=\\\"s2\\\"><strong>new business acquisition<\\/strong><\\/span><strong> is to <\\/strong><span class=\\\"s2\\\"><strong>exceed your quota<\\/strong><\\/span><strong>, then your <\\/strong><span class=\\\"s2\\\"><strong>tactics<\\/strong><\\/span><strong> would be something like:<\\/strong><\\/p>\\n<ul class=\\\"ul1\\\">\\n<li class=\\\"li1\\\"><em>Send no less than 50 letters of introduction to new prospects each week.<\\/em><\\/li>\\n<li class=\\\"li1\\\"><em>Make no less than 50 cold calls of introduction to new prospects each week.<\\/em><\\/li>\\n<li class=\\\"li1\\\"><em>Make no less than 20 face-to-face contacts with new prospects each week.<\\/em><\\/li>\\n<li class=\\\"li1\\\"><em>Create no less than 10 proposals each week.<\\/em><\\/li>\\n<li class=\\\"li1\\\"><em>Make no less than five presentations each week.<\\/em><\\/li>\\n<\\/ul>\\n<p class=\\\"p1\\\">Important note: Your numbers will, of course, vary. What\'s important here is that you calculate exactly how many contacts you\'ll need to make in order to achieve your sales quota.&nbsp;<\\/p>\\n<p class=\\\"p1\\\"><strong>Also, If your <\\/strong><span class=\\\"s2\\\"><strong>strategy<\\/strong><\\/span><strong> to&nbsp;capture high-margin, add-on business from your<\\/strong><span class=\\\"s2\\\"><strong> existing customers <\\/strong><\\/span><strong>is to <\\/strong><span class=\\\"s2\\\"><strong>Create a touch-point program<\\/strong><\\/span><strong>, then your <\\/strong><span class=\\\"s2\\\"><strong>tactics <\\/strong><\\/span><strong>would be something like:<\\/strong><\\/p>\\n<ul class=\\\"ul1\\\">\\n<li class=\\\"li1\\\"><em>Contact each of my existing customers no less than once per month with a new idea they cannot get from anyone else.<\\/em><\\/li>\\n<li class=\\\"li1\\\"><em>Create a noteworthy monthly newsletter.<\\/em><\\/li>\\n<li class=\\\"li1\\\"><em>Create a user-group within my existing customer base.<\\/em><\\/li>\\n<li class=\\\"li1\\\"><em>Create some sort of Web-based seminar series for my existing customers.<\\/em><